import React from "react";
import styled from "styled-components";

const CardBox = styled.div`
    width: 465px;
  height: 500px;
  background-color: gray;
  border-radius:5px;
  box-shadow: 0px 0px 3px 2px  lightgray;
  margin-top: 70px;
  margin-left: 210px;
  position:absolute;
  
`
const CardTitle = styled.p`
    font-size: 23px;
  font-weight: 400;
  color: white;
  position: absolute;
  margin-top: 130px;
  margin-left: 175px;
`
const ContentBox = styled.div`
    width: 465px;
    height:210px;
    background-color: white;
    border-radius:0px 0px 5px 5px;
    position: absolute;
   margin-top: 290px;
`
const CardContent = styled.p`
    font-size: 20px;
  font-weight: 500;
  text-align: left;
  margin-top: 20px;
  margin-left: 23px;
  margin-right: 40px;
  line-height: 33px;
`
const CardButton1 = styled.div`
    width: 62px;
    height: 35px;
    border: 1.4px solid black;
    border-radius: 5px 0px 0px 5px;
    margin-top: 20px;
    margin-left: 23px;
`
const ButtonText1 = styled.p`
  font-size: 19px;
  font-weight: 100;
  margin-top: 3px;
  margin-left: 11px;
`
const CardButton2 = styled.div`
    width: 54px;
    height: 35px;
    border: 1.4px solid black;
    border-radius: 0px 5px 5px 0px;
    margin-left: 84px;
    margin-top: -35px;
`
const ButtonText2 = styled.p`
   font-size: 19px;
  font-weight: 100;
  margin-top: 3px;
  margin-left: 11px;
`
const Time =  styled.p`
  font-size: 17px;
  color: gray;
  margin-left: 390px;
  margin-top: -25px;
`
// const MainBox = styled.div`
//     width: 100%;
//     height: 1600px;
//     background-color: lightgray;
//     margin-top: 130px;
// `



const Main = (props) =>{
    return(
        <>
        {/* <MainBox> */}
            <CardBox>
                <CardTitle>{props.cardTitle}</CardTitle>
              <ContentBox>
                <CardContent>{props.cardContent}</CardContent>
                  <CardButton1>
                  <ButtonText1>View</ButtonText1>
                  </CardButton1>
                 <CardButton2>
                  <ButtonText2>Edit</ButtonText2>
                  </CardButton2>
                  <Time>9 mins</Time>
              </ContentBox>
            </CardBox>
        {/* </MainBox> */}
        </>
    )
}
export default Main;
